import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('Sarabun-ExtraLightItalic-normal.ttf', font);
this.addFont('Sarabun-ExtraLightItalic-normal.ttf', 'Sarabun-ExtraLightItalic', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])


export default jsPDF;